import React, { Component, Fragment } from 'react';
import '../SearchResultItem.css';
import OverdueItemInfo from './OverdueItemInfo';
import DummyImage from '../../img/book_1.jpg'

class OverdueItem extends Component{

	render (){
		const bookInfo = this.props.data;
		console.log(bookInfo);
		const list = bookInfo.map(
		info => (<OverdueItemInfo	imgUrl={DummyImage} 
							id={info.id}
							bookTitle={info.title} 
							bookAuthor={info.author}
							checkout={info.checkout}/>));
		return (
			<Fragment>
				<div class="item-container">
					{list}
				</div>
			</Fragment>
		);
	}
}

export default OverdueItem;
